import React from "react";

const foodList = [
  { id: 1, name : "kimbap" },
  { id: 2, name : "bokkumbap" },
  { id: 3, name : "samgyupsal" },
]

function Food ({id, name, picture}) {
  return <div>I like {name}</div>
}

function renderFood (dish) {
  return <Food name={dish.name} />;
}

function App() {
  return ( 
    <div>
      {foodList.map(meal => (
        <Food key={meal.id}name={meal.name} />
      ))}
      {console.log(foodList.map(renderFood))}
    </div>
  );
}

export default App;
